const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>Welcome to BusinessCo</h1>
        <p>Your trusted partner in growth.</p>
        <button className="cta-btn">Learn More</button>
      </div>
    </section>
  );
}

export default Hero;
